window.bookSummaryJSON = "<p>The only thing protecting me from the demons...is the beast. Nyfain, the golden dragon prince, tried to set me free. But there is no freedom in this kingdom. Not for anyone.</p> <p>The demons have sought me out. They want to trap me. To use me against Nyfain.</p> <p>It's only a matter of time before they call in the demon king.</p> <p>Nyfain thinks I should save myself. That I should barter with the demon king to escape this place. But can I give myself to the creature responsible for torturing the people I love?</p> <p>In order to save them, though, I might not have a choice.</p>"; 
